Eigen::Vector4f NeuralNetwork::forward_propagation(float input[19])
{
    float output_0[128][1];
    float output_1[128][1];
    float output_2[4][1];

    // First layer
    for (int i = 0; i < 128; i++)
    {
        output_0[i][0] = 0;
        for (int j = 0; j < 19; j++)
        {
            output_0[i][0] += policy_network_w0_inp[i][j] * input[j];
        }
        output_0[i][0] += policy_network_b0_inp[i][0];
        output_0[i][0] = std::max(output_0[i][0], 0.0f);
    }
    // Second layer
    for (int i = 0; i < 128; i++)
    {
        output_1[i][0] = 0;
        for (int j = 0; j < 128; j++)
        {
            output_1[i][0] += policy_network_w1_inp[i][j] * output_0[j][0];
        }
        output_1[i][0] += policy_network_b1_inp[i][0];
        output_1[i][0] = std::max(output_1[i][0], 0.0f);
    }
    // Third layer
    for (int i = 0; i < 4; i++)
    {
        output_2[i][0] = 0;
        for (int j = 0; j < 128; j++)
        {
            output_2[i][0] += policy_network_w2_inp[i][j] * output_1[j][0];
        }
        output_2[i][0] += policy_network_b2_inp[i][0];
        output_2[i][0] = std::tanh(output_2[i][0]);
    }
    // Final output
    Eigen::Vector4f output;
    for (int i = 0; i < 4; i++)
    {
        output[i] = output_2[i][0];
    }
    return output;
}